import React from 'react';
import './Post.css';

const Modal = ({ active, setActive }) => {
  return (
    <div
      className={active ? 'modal active' : 'modal'}
      onClick={() => setActive(false)}
    >
      <div
        className={active ? 'modal-content active' : 'modal'}
        onClick={(e) => e.stopPropagation()}
      ></div>
    </div>
  );
};

export default Modal;
